import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import UserList from './UserList';

const Dashboard = () => {
  return (
    <div>
  <h2 className="text-center text-2xl font-bold mt-8">User List</h2>
      {/* Render the UserList component within the Dashboard */}
      <UserList />
      <div className="text-center mt-4">
        {/* Add a Link to navigate to the Users.js file as a button */}
        <Link
          to="/users" // Specify the path to the Users.js route
          className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded inline-block"
        >
          View Users
        </Link>
      </div>
    </div>
  );
};

export default Dashboard;
